/**
* 获取表格数据
*/

$(document).on('click',".nav-link.sec-lv",function(){

    $.cookie('SELECTED_MODULE_UUID', $(this).closest('.sub-menu').prev("a").data('uuid'),{ path: '/'});
    $.cookie('SELECTED_AUTHORITY_UUID', $(this).data('uuid'),{ path: '/'});

    window.location.href=$(this).data('link')

});